import { Component } from 'react';
import BottomNav from '../components/BottomNav/BottomNav';
// import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

import iconLinkedin from '../assets/icons-feather-1.5px/linkedin.svg';
import iconGithub from '../assets/icons-feather-1.5px/github.svg';
import iconEmail from '../assets/icons-feather-1.5px/mail.svg';

class Profile extends Component {

  state = {
    user_id: parseInt(localStorage.getItem('user_id'))
  }

  render() {

    console.log(`Hi, I'm the profile for user --> `, this.state.user_id)

    return (
      <section className="about-me">
        <h1 className="about-me__name">Cristian Niculescu</h1>

        {/* <h2>Email:</h2> */}
        <img className="icon" src={iconEmail} alt="email icon" />
        <h4><a href="mailto:Cristian.Niculescu@gmail.com">Cristian.Niculescu@gmail.com</a></h4>

        {/* <h2>Github:</h2> */}
        <img className="icon" src={iconGithub} alt="email icon" />
        <h4><a href="https://github.com/CristianNic">https://github.com/CristianNic</a></h4>

        {/* <h2>LinkedIn:</h2> */}
        <img className="icon" src={iconLinkedin} alt="linked icon" />
        <h4><a href="https://www.linkedin.com/in/cristian-niculescu/">https://www.linkedin.com/in/cristian-niculescu/</a></h4>

        <div className="farewell">
          <h2>Hope you had fun exploring</h2>
          <h2>our beautiful city!</h2>
        </div>

        <BottomNav />
      </section>
    );
  }
}

export default Profile;
